@Test
  public void prependTo_prependsProperSql() {
    /* Given */
    InsertOrAbortImpl insertOrAbort = new InsertOrAbortImpl();
    RawSqlBuilder builder = new RawSqlBuilderImpl();

    /* When */
    insertOrAbort.prependTo(builder);

    /* Then */
    assertThat(builder.toString(), is("INSERT OR ABORT"));
  }

